function get_bh(bh){
  if(bh == null){
    return null;
  }

  let begin = bh.indexOf(' ');
  return bh.substring(begin);
}

function get_date(){
  let date = new Date();
  diff = (date.getTimezoneOffset() / 60 + 8) * 60 * 60 * 1000;

  return new Date(date.getTime() + diff);
}

exports.handler = function (event, context, callback) {
  const headers = {
    'Access-Control-Allow-Origin': '*',
    // 'Access-Control-Allow-Headers': 'Origin, X-Requested-With, Content-Type, Accept',
  };

  let idx = Math.floor(Math.random() * rests.length);
  // idx = 357
  let rest = rests[idx];
  console.log(rest)
  let date = get_date();
  let d = date.getDay();
  d = (d != 0) ? d - 1 : 6;

  let bh = (rest.bh==null)? null: get_bh(rest.bh[d]);

  let body = {
    addr: rest.addr,
    bh: bh,
    href: `http://maps.google.com/?q=${rest.title} ${rest.addr}`,
    ctgs: rest.ctgs,
    title: rest.title,
  }

  rest.href = `http://maps.google.com/?q=${rest.title} ${rest.addr}`

  callback(null, {
    statusCode: 200,
    headers,
    body: JSON.stringify({
      rest: body,
    })
  });
}